INSERT INTO `settings_email_template` (`id`, `key`, `description`, `subject`, `body`, `from`, `comments`, `date_created`, `created_by`) VALUES
(2, 'admin_reset_password', 'Email sent to a user when the admin resets the user''s password', 'New Password', 'Hi {name}, You Password has been reset by the web master.Here are your new login details\r\n<ul>\r\n	<li>Username: <strong>{username}</strong> or <strong>{email}</strong></li>\r\n	<li>Password: <strong>{password}</strong></li>\r\n</ul>\r\n       To login now please <a target="_blank" rel="nofollow" href="http://{link}">click here</a> or copy and paste this link to your browser: {link} <br>\r\n <br>\r\n<p>\r\n	      Smart County Team.\r\n</p>', 'noreply@toamaoni.co.ke', 'Placeholders: {name}=> The Admin full name, {username}=>admin username, {email}=>admin email,{password} => The new password, {link}=> Login link ', '2013-09-27 10:43:30', 2),
(3, 'forgot_password', 'Email sent to a user who forgot his/her password to asssist in password recovery', 'Password Recovery', '<p>\r\n	  Hello {name},\r\n</p>\r\n  Please <a target="_blank" rel="nofollow" href="http://{link}">click here</a> or copy and paste this link: {link} to your browser to change your password.<br>\r\n<p>\r\n	    If you never initiated this password recovery process, please just ignore this email.\r\n</p>\r\n<p>\r\n	  Smart County Team\r\n</p>', 'noreply@toamaoni.co.ke', 'Placehoders: {name}=>The name of the user, {link}=>link for reseting password', '2013-09-27 10:43:48', 2),
(5, 'new_user', 'Email sent to a new user when informing the user of his/her new account.', 'Login Details', '<p>\r\n	     Hi {name},\r\n</p>\r\n<p>\r\n	     Your account for {site_name} has been created. These are your login details:\r\n</p>\r\n<ul>\r\n	<li>Username :<strong>{username}</strong> or <strong>{email}</strong></li>\r\n	<li>Password:<strong>{password}</strong></li>\r\n</ul>\r\n      To login now please  <a target="_blank" rel="nofollow" href="http://{link}">click here</a>\r\n<p>\r\n	  or copy and paste this link to your browser: {link}\r\n</p>\r\n<p>\r\n	Smart County Team\r\n</p>', 'noreply@toamaoni.co.ke', NULL, '2013-12-16 21:58:05', 1);
